main.c int add(a, b) { return a + b;
} Let's try to get this to compile and run ... in our web browser! First, we'll need to compile it to a .wasm file. You can use clang if you want, there's great resources for that here . However, I found that the commands that are supplied there ... don't consistently work across platforms. Plus, clang is clunky. Let's use zig to wrap up that whole LLVM mess for us, into one reasonable, consistent executable. vim main.c mkdir build
cd build zig build-lib \ --export add \ -dynamic -target wasm32-freestanding ../main.c

